import React, { Component } from 'react';
import DuckLogo from './DuckLogo.png';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={DuckLogo} className="App-logo" alt="logo" />
          <p>
            Here is the boilerplate REACT for our FullQuack App.  Server is currently running on <code>localhost:5000</code>. You can navigate to http://localhost:5000/api/posts/ to see an empty MongoDB array (unless you've added users on your local MongoDB).
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
